import React from 'react';

import UsersList from '../Components/UsersList';
import WaveSubmit from '../Components/WaveSubmit';

class HomePage extends React.Component {
    
    render(){
        return(
            <div data-testid = "homepage">
                <div className = "row">
                    <div className = "col-8">
                        <WaveSubmit/>
                    </div>
                    <div className = "col-4">
                        <UsersList></UsersList>
                    </div>
                </div>
            </div>
        );
    };
}

export default HomePage;
